request.description:
https://services.tokenview.com/vipapi/address/usdt/{地址}/1/50?apikey={apikey}

##### 支持币种：usdt-omni
##### 如果地址不包含USDT的交易，返回404.

https://services.tokenview.com/vipapi/utils/cashaddr/{新老格式地址之一}?apikey={apikey}

**备注：**

+ 地址无效，返回 40001代码
+ 地址有效，返回新格式地址和老格式地址如下：
 {cashAddress: 新格式地址, legacyAddress: 经典格式地址}

https://services.tokenview.com/vipapi/addr/b/{公链简称小写}/{地址}?apikey={apikey}

##### 支持币种：ETH, ETC, TRX, NEO, ONT, IOST, UGAS, ATOM, WAN, PI。

##### 调用ETH接口时，请务必将地址hash或交易hash中的大写字母转化程小写字母。

