request.description:
https://services.tokenview.com/vipapi/coin/abstract/{公链简称小写}?apikey={apikey}

##### Logo URL 格式：

https://services.tokenview.com/vipapi/icon/{币简称小写.png}?apikey={apikey}

##### 获得公链基本信息包括：名称、简称、LOGO、流通量、发行总量，市值，成交量，涨跌幅等。

https://services.tokenview.com/vipapi/tx/confirmation/{公链简称小写}/{交易hash}?apikey={apikey}

##### 应答字段说明
``` Javascript

"data": {
    "network": "ETH", // 公链的简称
    "txId": "0x914443ef1e9028e031ace86264593afc4d03fbdb77725ef92bcd75b2f9a8df26", // 交易hash
    "confirmation": 3966037 // 此交易的确认数
}

```

https://services.tokenview.com/vipapi/pending/{公链简称小写}/{交易id}?apikey={apikey}

##### 1. 待确认交易：交易还等待打包，还没有进入到区块链里。如果返回404，说明待确认队列里，没有这笔交易，交易已成功或失败。


##### 2. 如果该交易在待确认队列里，应答如下（因为还没打包，所以块高未知）：

``` JavaScript

"data": {
    "type": "tx",
    "network": "USDT",
    "time": 1580960486,
    "txid": "d39c6869d7a29e65497f0fd77b73ad4f2ce5ce67a2fd79751152991629c4a37c",
    "fee": "0.00000385", // 该交易的手续费（此例单位BTC）
    "inputs": [          // inputs里是转出币的地址列表
        {
            "address": "1PZURD3iK4bi6kCGXku5cGzcNgixdYiyVx", // 地址hash
            "value": "0.00960000" //  转出的数量（此例的单位是USDT）
        }
    ],
    "outputs": [
        {
            "address": "12VEdpqGKU2QM16AgtYzNYwRqGF4nKQbWB", // 地址hash
            "value": "0.00960000" // 收到的数量（此例的单位是USDT）
        }
    ],
    "type_int": 0,  // 交易类型代号
    "type_str": "Simple Send" // 交易类型，普通转账
}
```

