request.description:
https://services.tokenview.com/vipapi/address/balancetrend/{公链简称}/{地址}?apikey={apikey}

**支持币种：** 同上。

##### 应答字段说明

``` Javascript

    "data": [
        {
            "2021-11-03": "0.09966324272259898"
        },
        {
            "2021-11-02": "0.09966324272259898"
        },
]

```

https://services.tokenview.com/vipapi/monitor/stablecoin/add/{币简称小写}?apikey={apikey}

**备注:**
币种简称支持：USDT，USDC，GUSD，sUSD，TUSD，PAX，HUSD

https://services.tokenview.com/vipapi/monitor/stablecoin/list?page={页码}apikey={apikey}

**备注:**

需指定页码。

https://services.tokenview.com/vipapi/monitor/address/remove/{币简称小写}/{地址hash}?apikey={apikey}

**备注:**

需指定币种名称和地址hash

https://services.tokenview.com/vipapi/monitor/address/list/{币简称小写}?page={页码}apikey={apikey}

**备注:**

需指定币种名称和页码。
